    public static List<String> findStringDiff(String s1, String s2) {
        char[] chars1 = s1.toCharArray();
        char[] chars2 = s2.toCharArray();
        int index = 0;
        int index1 = 0;
        char[] res1 = new char[chars1.length];
        char[] res2 = new char[chars2.length];
        for (char b1 : chars1) {
            char b2 = chars2[index++];
            if (b1 != b2) {
                res1[index1++] = b1;
                res2[index1++] = b2;
            }
        }

        String rs1 = String.valueOf(res1);
        String rs2 = String.valueOf(res2);
        List<String> res = new ArrayList<>();
        res.add(rs1);
        res.add(rs2);
        return res;


    }

    public static String generationExecution(int size) {
        String area = "1234567890abcdefghijklmnopgrstuvwxyz";
        char[] chars = area.toCharArray();
        Random random1 = new Random();
        char[] res = new char[size];
        for (int j = 0; j < size; j++) {
            int i = random1.nextInt(35);
            res[j] = chars[i];
        }
        String s = String.valueOf(res);
        String substring1 = s.substring(0, 8);
        String substring2 = s.substring(8, 12);
        String substring3 = s.substring(13, 17);
        String substring4 = s.substring(17, 21);
        String substring5 = s.substring(22);
        String linkChar = "-";

        return substring1 + linkChar + substring2 + linkChar + substring3 + linkChar + substring4 + linkChar + substring5;
    }

